import React, { Component } from 'react';
import $ from "jquery";

class RegistrosSalvos extends React.Component {

    constructor(props) {
        super(props);
        this.state = { date: new Date(), dados: [] };
        this.buscar.bind(this);

    }

    buscar = () => {
        let self = this;
        $.ajax({
            url: 'http://localhost:8080/registroPonto/lista',
            type: 'GET',
            success: function (result) {
                self.setState({ dados: result });
            }
        });
    }

    render() {
        console.log(this.state)
        return (
            <div style={{ marginLeft: '100px',
                marginRight: '100px'}}>
                <button onClick={this.buscar} style={{ borderRadius: "10px", backgroundColor: "lightblue", padding: "4px" }}>
                    <label style={{ fontSize: '15px'}}>Mostrar registros</label>
                </button>
                <table id='tabelaRegistro'>
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Data e Hora</th>
                            <th scope="col">Latitude</th>
                            <th scope="col">Longitude</th>
                            <th scope="col">IP</th>
                            <th scope="col">Caminho imagem salva</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.dados.map((item, idx) => {
                                return (
                                    <tr>
                                        <th scope="row">{item.id}</th>
                                        <td style={{ width: "15%" }}>{item.dataEHora}</td>
                                        <td style={{ width: "15%" }}>{item.latitude}</td>
                                        <td style={{ width: "15%" }}>{item.longitude}</td>
                                        <td style={{ width: "15%" }}>{item.ipMaquina}</td>
                                        <td style={{ width: "15%" }}>{item.caminhoImagemSalva}</td>
                                    </tr>
                                )    
                            })
                        }
                        
                    </tbody>
                </table>
            </div >
        );
    }
}

export default RegistrosSalvos;
